file:
- statement:
  - select_statement:
    - select_clause:
      - keyword: SELECT
      - select_clause_element:
        - column_reference:
          - identifier: id
    - from_clause:
      - keyword: FROM
      - from_expression:
        - from_expression_element:
          - table_expression:
            - table_reference:
              - identifier: mytable
    - qualify_clause:
      - keyword: qualify
      - expression:
        - function:
          - function_name:
            - function_name_identifier: count
          - bracketed:
            - start_bracket: (
            - star: '*'
            - end_bracket: )
          - over_clause:
            - keyword: over
            - bracketed:
              - start_bracket: (
              - window_specification:
                - partitionby_clause:
                  - keyword: partition
                  - keyword: by
                  - expression:
                    - column_reference:
                      - identifier: id
              - end_bracket: )
        - comparison_operator: '>'
        - literal: '1'
- statement_terminator: ;
